import { ScrollView, StyleSheet, Button, View, SafeAreaView, Text, Alert, Platform  } from 'react-native'
import { Video } from 'expo-av'
import React from 'react'
import VideoPlayer from 'expo-video-player'
import Constants from 'expo-constants';
import * as Segment from 'expo-analytics-segment';
import * as Amplitude from 'expo-analytics-amplitude';
import * as Application from 'expo-application';
import { UnavailabilityError } from '@unimodules/core';


Segment.initialize({
  iosWriteKey: "dvHY8AWKFtchJ5R146WyuAsHy45Tak1F",
  androidWriteKey: "rMtRzfD2wS4dyjQVw0RrWcM4ZRnEAzG9",
})
Segment.track('pageLoad')


Amplitude.initialize('b000c3d0ca796cc59fd71f6935584882')
Amplitude.logEvent('pageLoad')
Amplitude.setUserProperties(
  'device_id',
  'app_version',
  'platform',
  'os_name',
  'os_version',
  'device_brand',
  'device_manufacturer',
  'device_model',
  'carrier',
  'country',
  'city',
  'dma',
  'adid',
  'idfa',
  'ip_address',
)


let isInitialized = true

const App = () => (


  <ScrollView style={styles.container} contentContainerStyle={styles.contentContainer}>
  <Video
      source={{ uri: 'http://d23dyxeqlo5psv.cloudfront.net/big_buck_bunny.mp4' }}
      rate={1.0}
      volume={1.0}
      isMuted={true}
      resizeMode="contain"
      shouldPlay
      isLooping
      style={{ width: '100%', height:700}}
/>

  </ScrollView>
)

const styles = StyleSheet.create({
  container: {
    backgroundColor: 'transparent',
    flex: 1,
  },
  contentContainer: {
    alignItems: 'center',
    justifyContent: 'center',
  },
  backgroundVideo: {
  position: 'absolute',
  top: 0,
  left: 0,
  bottom: 0,
  right: 0,
},
})

export default App
